    """'nummerDerLinie’ ist die von einem Betreiber einer Bahnlinie festgelegte Nummer oder Kennziffer (z. B. U3
    oder S3)."""

    spurweite: list['AX_Spurweite']
    """'Spurweite' beschreibt den Abstand der Schienen eines Gleises zueinander."""

