class TA_PointComponent(AG_ObjektMitGemeinsamerGeometrie):
    """TA_PointComponent ist eine Klasse von punktförmigen Fachobjekten, die einfachen topologischen Raumbezug
    haben und gleichzeitig entsprechende Punktgeometrie realisieren. Insofern sind diese Fachobjekte mit den im
    Modul "Simple Topology" von ISO 19107 definierten TS_PointComponent identisch. Jeder referenzierte Knoten
    (TS_Node)  realisiert gleichzeitig die Eigenschaften eines GM_Point. Topologie und Geometrie fallen also
    zusammen. Die von einer TA_PointComponent referenzierten Knoten / Punkte sind überschneidungsfrei in einem
    topologischen Thema organisiert.  Zusätzlich zu diesen topologisch - geometrischen Eigenschaften gehören die
    Knoten / Punkte einem Punkt-Linienthema an, das es ermöglicht, dass die Linienendpunkte auch von anderen
    Objekten genutzt werden können, die zum gleichen Punkt-Linienthema gehören."""


